import axios from 'axios';
import React, {useEffect} from 'react';


const Patient_list = () =>{
    const baseurl = 'http://49.50.167.136:9871/'

    useEffect(()=>{
        axios.get(baseurl+'api/patient/list?page=1&order_desc=false')
        .then((res)=>{
            console.log(res.data)
        }).catch((err)=>{
            console.log(err)
        })
    })

    return(
        <div>
            <p>Patient_list</p>

        </div>
    )
}

export default Patient_list
